# https://leetcode.com/problems/3sum/description/
import random


class Solution:
    def threeSum(self, nums: list[int]) -> list[list[int]]:
        vals = {}
        ints = []
        for num in nums:
            if num in vals and vals.get(num) < 3:
                vals[num] = vals.get(num) + 1
                ints.append(num)
            elif num not in vals:
                vals[num] = 1
                ints.append(num)
        nums = ints
        vals = {}
        for index, num in enumerate(nums):
            if num in vals:
                vals.get(num).append(index)
            else:
                vals[num] = [index]

        result = set()

        for i in range(len(nums) - 2):
            for j in range(i + 1, len(nums) - 1):
                wanted = (nums[i] + nums[j]) * -1
                if wanted in vals:
                    for index in vals.get(wanted):
                        if index > j:
                            result.add(tuple(sorted([nums[i], nums[j], nums[index]])))

        return [list(r) for r in result]


